(defn nth-error-elite [n result] (:genotype (nth (sort-by :error (:elite result)) n)))

(defn table-row-error [n] ((juxt identity
                           (fn [ex] (score/abs-error vars coords spea2-data ex))
                           tree/count-nodes      
                           #(plot-exp % 200)) (nth-error-elite n result)))


(table/table-view (mapv table-row-error (vec (range 0 49 7))) :columns ["Genotype" "Score" "complexity" "Plot"])
