;; **
;;; defining a few key functions needed for the max-population limmit experiement.
;; **

;; @@
(def i-z
  (evolution/make-zeitgeist (genetics/ramped-half-and-half-population spea2-functions spea2-terminals 50 6)))

(defn create-iz
  [x]
  (def init-z (evolution/make-zeitgeist (genetics/ramped-half-and-half-population spea2-functions spea2-terminals x 6))))


;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/create-iz</span>","value":"#'joel-spea2-algebolic/create-iz"}
;; <=

;; @@
(defn create-config
  "Creates an istance of a general spea2 config with limit n for the max population"
  [n]
  
  (def g-c			     ; creates 
  (let [size-limit n                   ; let used to spell out params ect.
        min-size 10
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size 50
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 20}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation spea2-functions spea2-terminals 3) :repeat 10}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords spea2-data ex))}]
    {:ea-config              ea-config
     :score-functions        score-functions
     :reporting-function     (fn [z] (print "") (flush))})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/create-config</span>","value":"#'joel-spea2-algebolic/create-config"}
;; <=

;; @@
(defn evolve-result 
  "given an innital zeitgeist, general configuration, evolves soultions until a desired generation
  produces a 'result' - the final population"
  [g-c i-z gen] 
  (def r-result (evolution/run-evolution g-c i-z (fn [zg gc] (>= (:age zg) gen))))
  (println "defined a new r-result"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/evolve-result</span>","value":"#'joel-spea2-algebolic/evolve-result"}
;; <=

;; @@
(defn best-of-gen
  [result]
  "picks out the best error solution from a population"
  (:error (first (sort-by :error (:elite result)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/best-of-gen</span>","value":"#'joel-spea2-algebolic/best-of-gen"}
;; <=

;; @@
(defn run-average
  [temps]
  (/ (apply + temps) (count temps)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/run-average</span>","value":"#'joel-spea2-algebolic/run-average"}
;; <=

;; @@
(defn splerge
  [A B]
  (vec (map (fn [x y] [x y]) A B)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;joel-spea2-algebolic/splerge</span>","value":"#'joel-spea2-algebolic/splerge"}
;; <=

;; @@
(defn experiment-run
  
  "pop-range max = largest maximum population defined in the confgure
   pop-range-interval = the incremenetal steps over the pop-max range
   gen-evolve = number of evolutions for a generation
   run-repeat = number of iterations performed for each max-pop
   init-pop = innitial zeitgeist population size
  "
  
  [pop-range-max pop-range-interval gen-evolve run-repeat init-pop]

  (def x-coords []) 
  (def y-coords [])

  (loop [max-pop-size 20]
    
    (def temp-y [])
  
  	(println "max size" max-pop-size)
    	(def x-coords (conj x-coords max-pop-size))
  			(create-config max-pop-size)
    						(println "finished evolve")
    						
    
    ;;;;;
    
    						(loop [run 0]
                              	(create-iz init-pop)
                              		(evolve-result g-c init-z gen-evolve)
                             				 (def temp-y (conj temp-y (best-of-gen r-result)))
                              
                              
                              (if (< run run-repeat)         
                                
                              (recur (inc run))))
    
    (println "average score:"(run-average temp-y))
    
    (def y-coords (conj y-coords (run-average temp-y)))
    
    ;;;;
    
    
  	(if (< max-pop-size pop-range-max)
    
    (recur 	(+ pop-range-interval max-pop-size)))
    
    
  )
  (println "x-coords" x-coords)
  (println "y coords" y-coords)
  
  (def plot-coords (splerge x-coords y-coords) )
  
  (plot/compose
    (plot/list-plot plot-coords))
  )
